import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './styles/about.less';
import '../global/global.less';
import meSvg from './img/me.svg';
import dogSvg from './img/dog.svg';
import cookieSvg from './img/cookie.svg';
import engineerSvg from './img/engineer.svg';
import bulletJournalSvg from './img/bulletjournal.svg';

class About extends Component {
  render() {
    return (
      <div className="about">
          <img className="about-me" src={meSvg} />
          <div className="about-bar"></div>
          <div className="about-icons" href="https://www.linkedin.com/in/chloeshiau/">
            <svg className="about-icon" id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 340.53 247.63">
            <path
              class="cls-1"
              d="M119.24,202.22l271.54-.86c-.07-83.33-.64-144.21-1-158.14-.08-3.31-.4-11.2-6-14.61-2-1.22-4.26-1.51-13.1-1.8a124.54,124.54,0,0,0-16.08.09c-21.56,1.74-180.22,3.45-204.25,1a61.89,61.89,0,0,0-16.35.77c-4.95.89-7.62,1.46-9.79,3.17-3.75,3-4.42,7.41-4.68,9.08C118.24,49.57,118.13,114,119.24,202.22Z"
              transform="translate(-83.75 -23.1)"/>
              <text class="cls-2" transform="translate(99.09 102.08) scale(1.1 1)">
                &lt;/st
                <tspan class="cls-3" x="51.25" y="0">r</tspan>
                <tspan x="60.69" y="0">ong&gt;</tspan>
              </text>
              <path
                class="cls-4"
                d="M244.9,269"
                transform="translate(-83.75 -23.1)"/>
              <path
                class="cls-5"
                d="M116.13,201.8c-3.55,5.87-16.22,26.89-28.34,48.19-2.08,3.65-6,10.75-2.87,14.77,2.26,2.89,7.2,2.94,8.63,3,143.25,3.5,198.85,3.22,310,2.67,3.89,0,15.63,0,19.49-6.08,3.34-5.29-.83-12.63-6.23-22.17-5-8.88-12.11-21.44-22.72-40.35"
                transform="translate(-83.75 -23.1)"
              />
              <path
                class="cls-6"
                d="M123.61,208.6c-3.35,4.67-15.3,21.36-26.74,38.27-2,2.9-5.67,8.54-2.69,11.72,2.14,2.29,6.81,2.33,8.16,2.35,135.49,2.61,188.06,2.32,293.22,1.75,3.68,0,14.78,0,18.43-4.85,3.15-4.2-.81-10-5.93-17.58-4.76-7-11.48-17-21.53-32"
                transform="translate(-83.75 -23.1)"/>
              <rect class="cls-5" x="116.34" y="218.58" width="112.56" height="8.35"/>
            </svg>
            <img className="about-icon cookie" src={cookieSvg} />
            <img className="about-icon" src={dogSvg} />
            <img className="about-icon" src={bulletJournalSvg} />
          </div>
          <div className="about-title">
            <div className="about-icon">software engineer</div>
            <div className="about-icon cookie">small business owner</div>
            <div className="about-icon">dog momma</div>
            <div className="about-icon">bullet journaler</div>
          </div>
      </div>
    );
  }
}

export default About;
